    //     deployedCampaigns.push(newCampaign);
    // }

    function createCampaign(string title, string authorName, string email, string photoSrc, string desc, string to, uint minimum) public {
        address newCampaign = new Project(
            title,
            authorName,
            email,
            photoSrc,
            desc,
            to,
            minimum,
            msg.sender
        );
        deployedCampaigns.push(newCampaign);
    }

    function getDeployedCampaigns() public view returns (address[]) {
        return deployedCampaigns;
    }
}

contract Project {

    Request[] public requests;
    address public manager;
    uint public minimumContribution;
    mapping(address => bool) public approvers;
    uint public approversCount;

    struct productDetail {
        string title;
        string authorName;
        string email;
        string photoSrc;
        string desc;
        string to;
        uint minimum;
    }

    productDetail public _detail;

    // constructor(uint minimum, address creator) public {
    //     manager = creator;
    //     minimumContribution = minimum;
    // }

    constructor(
        string title,
        string authorName,
        string email,
        string photoSrc,
        string desc,
        string to,
        uint minimum,
        address creator) public {

        productDetail memory detail = productDetail(
            title,
            authorName,
            email,
            photoSrc,
            desc,
            to,
            minimum
        );
        manager = creator;
        minimumContribution = minimum;
        _detail = detail;
    }

    struct Request {
        string description;
        uint value;
        address recipient;
        bool complete;
        uint approvalCount;
        mapping(address => bool) approvals;
    }



    modifier restricted() {
        require(msg.sender == manager);
        _;
    }


    function contribute() public payable {
        require(msg.value > minimumContribution);

        approvers[msg.sender] = true;
        approversCount++;
    }

    function createRequest(string description, uint value, address recipient) public restricted {
        Request memory newRequest = Request({
            description: description,
            value: value,
            recipient: recipient,
            complete: false,
            approvalCount: 0
            });

        requests.push(newRequest);
    }

    function approveRequest(uint index) public {
        Request storage request = requests[index];

        require(approvers[msg.sender]);
        require(!request.approvals[msg.sender]);

        request.approvals[msg.sender] = true;
        request.approvalCount++;
    }

    function finalizeRequest(uint index) public restricted {
        Request storage request = requests[index];

        require(request.approvalCount > (approversCount / 2));
        require(!request.complete);

        request.recipient.transfer(request.value);
        request.complete = true;
    }

    function getSummary() public view returns (
        uint, uint, uint, uint, address
    ) {
        return (
        minimumContribution,
        this.balance,
        requests.length,
        approversCount,
        manager
        );
    }

    function getRequestsCount() public view returns (uint) {
        return requests.length;
    }

